// src/modules/fivSpeedGrade/FivTableView.jsx
import React, { useState } from "react";
import { useLanguage } from "../../i18n/LanguageContext";
import { getModuleStrings } from "../../i18n/appStrings";
import { SPEED_GRADE_TABLES } from "../../utils/speedGradeTables";
import { PM_FIV_GROUPS } from "./fivHelpers";

export default function FivTableView() {
  const { lang } = useLanguage();
  const t = getModuleStrings("fivSpeedGrade", lang);

  const [selectedGroup, setSelectedGroup] = useState("gasoline_passenger");

  const speeds = pmFiv.metadata.speeds_kmh;
  const grades = pmFiv.metadata.grades_percent;
  const tableData = pmFiv.vehicle_classes[selectedGroup]?.fiv_table || [];

  return (
    <section style={outerSection}>
      <h2 style={{ marginTop: 0 }}>{t.tableTitle || "PM f_iv Lookup Table"}</h2>
      
      <p style={description}>
        {t.tableDescription || "Complete speed-grade correction factor table for PM emissions."}
      </p>

      {/* Vehicle group selector */}
      <div style={selectorRow}>
        <label style={label}>{t.selectGroupLabel || "Vehicle Group:"}</label>
        <select 
          value={selectedGroup} 
          onChange={(e) => setSelectedGroup(e.target.value)}
          style={select}
        >
          {PM_FIV_GROUPS.map((g) => (
            <option key={g.jsonKey} value={g.jsonKey}>
              {g.id.toUpperCase()} - {g.labelKo}
            </option>
          ))}
        </select>
      </div>

      {/* Full table */}
      <div style={tableContainer}>
        <table style={table}>
          <thead>
            <tr>
              <th style={thCorner}>Speed (km/h) \ Grade (%)</th>
              {grades.map((grade) => (
                <th key={grade} style={thGrade}>
                  {grade > 0 ? `+${grade}` : grade}%
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {speeds.map((speed, rowIdx) => (
              <tr key={speed}>
                <td style={tdSpeed}>{speed}</td>
                {grades.map((grade, colIdx) => (
                  <td key={`${speed}-${grade}`} style={tdValue}>
                    {tableData[rowIdx]?.[colIdx] ?? "—"}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <p style={note}>
        {t.tableNote || "Values represent f_iv correction factors. Rows = speed (km/h), Columns = grade (%)."}
      </p>
    </section>
  );
}

/* ---------- styles ---------- */

const outerSection = {
  border: "1px solid #ddd",
  borderRadius: 8,
  padding: 16,
  margin: 16,
  background: "#fafafa"
};

const description = {
  fontSize: 12,
  color: "#555",
  marginBottom: 12
};

const selectorRow = {
  display: "flex",
  alignItems: "center",
  gap: 8,
  marginBottom: 16
};

const label = {
  fontSize: 13,
  fontWeight: 500,
  color: "#333"
};

const select = {
  fontSize: 13,
  padding: "6px 8px",
  borderRadius: 4,
  border: "1px solid #ccc",
  minWidth: 280,
  cursor: "pointer"
};

const tableContainer = {
  overflowX: "auto",
  border: "1px solid #ccc",
  borderRadius: 4,
  marginBottom: 12
};

const table = {
  width: "100%",
  borderCollapse: "collapse",
  fontSize: 11,
  minWidth: 800
};

const thCorner = {
  position: "sticky",
  left: 0,
  background: "#e8e8e8",
  borderBottom: "2px solid #999",
  borderRight: "2px solid #999",
  padding: "6px 8px",
  textAlign: "center",
  fontWeight: 600,
  zIndex: 2
};

const thGrade = {
  background: "#f5f5f5",
  borderBottom: "2px solid #999",
  borderRight: "1px solid #ddd",
  padding: "6px 8px",
  textAlign: "center",
  fontWeight: 600,
  minWidth: 60
};

const tdSpeed = {
  position: "sticky",
  left: 0,
  background: "#f9f9f9",
  borderBottom: "1px solid #ddd",
  borderRight: "2px solid #999",
  padding: "4px 8px",
  textAlign: "center",
  fontWeight: 500,
  zIndex: 1
};

const tdValue = {
  borderBottom: "1px solid #eee",
  borderRight: "1px solid #ddd",
  padding: "4px 8px",
  textAlign: "center",
  background: "#fff"
};

const note = {
  marginTop: 8,
  fontSize: 11,
  color: "#777",
  fontStyle: "italic"
};
